description.text:
Using OpenSCAD files, at the top in the configurables:-<br />
// CNC PARTS<br />
// flat=0 for model, not suitable for CNC Machine.<br />
// flat = 1 for print of set of ramps including the base<br />
// flat = 2 only print the &quot;extra set of ramps&quot; (used when ramps &gt;1)<br />
// flat = 3 only print parts for a car
flat=3;
// Pairs of ramps<br />
ramps = 1;
// MAIN Material configurations<br />
material_t = 12;<br />
height_of_ramp = 180;<br />
length_of_ramp = 180;
